import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Switch,
  useRouteMatch,
  useParams,
  useHistory,
  Link,
} from "react-router-dom";
import Page1 from "./Page1";
import Page2 from "./Page2";
import Page3 from "./Page3";
import NotFound from "../notFound";
import { Space, Menu } from "antd";

export default function ProfileUser() {
  const match = useRouteMatch();
  const params = useParams();
  const history = useHistory();
  console.log(history);
  console.log(params);
  console.log(match);
  const handleClick = () => {
    history.push("/");
  };

  return (
    <Router>
      <Menu
        // onClick={this.handleClick}
        style={{ width: 256 }}
        defaultSelectedKeys={["1"]}
        defaultOpenKeys={["sub1"]}
        mode="inline"
      >
        <Menu.Item key="0">Option 9</Menu.Item>
        <Menu.Item key="1">Option 10</Menu.Item>
        <Menu.Item key="2">Option 11</Menu.Item>
        <Menu.Item key="3">Option 12</Menu.Item>
      </Menu>
      <ul>
        <li>
          <Link to={`${match.url}/page1`}>page 1</Link>
        </li>
        <li>
          <Link to={`${match.url}/page2`}>page 2</Link>
        </li>
        <li>
          <Link to={`${match.url}/page3`}>page 3</Link>
        </li>
      </ul>
      <Switch>
        <Route exact path={`${match.url}/page1`} component={Page1} />
        <Route path={`${match.url}/page2`} component={Page2} />
        <Route path={`${match.url}/page3`} component={Page3} />
        <Route path={`${match.url}/*`} component={NotFound} />
      </Switch>
    </Router>
  );
}
